import Nav from './Nav'
import CodingImg from './image/codingimg.png';
import servicesleft from './image/services-left-dec.png';
import portfolioleft from './image/portfolio-left-dec.png';
import contactdec from './image/contact-dec.png';
import contactleft from './image/contact-left-dec.png';
import Trends from "./Components/Trends/Trends";
import { useEffect,useState } from 'react';

export default function Home() {

    
const [pname, setPname] = useState("");
const [token, setToken] = useState("");

useEffect(()=>{
setPname(JSON.parse(localStorage.getItem('user-info')));
localStorage.setItem('token', JSON.stringify(pname.token));
},[])
console.log("")
    return (
        <div>
            <Nav />

            {/* <!-- Mashead header--> */}
            <header className="masthead" >
                <div className="container px-md-5">
                    <div className="row gx-5 align-items-center">
                        <div className="col-lg-5" >
                            {/* <!-- Mashead text and app badges--> */}
                            <div className="mb-5 mb-lg-0 text-center text-lg-start">
                                <h1 className="display-4  mb-3 fw-bold">Showcase your app <span className="text-header">beautifully</span>.</h1>
                                <p className="lead fw-normal text-muted mb-3">Launch your mobile app landing page faster with this free, open source theme.</p>
                                <button type="button" className="btn mybutton btn-outline-header bg-header rounded-pill">Get Started</button>
                            </div>
                        </div>
                        <div className="col-lg-7" >
                            {/* <!-- Masthead device mockup feature--> */}
                            <div className="masthead-device-mockup">
                             <div className="device-wrapper">
                                    <div className="device" data-device="iPhoneX" data-orientation="portrait" data-color="black">
                                        <div className="screen bg-black">
                                            {/* <img src = "image/codingimg.png" /> */}
                                            <img src={CodingImg} width="100%" />
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </header>

            <div className="masthead1 bg-light"  style={{backgroundImage: `url(${servicesleft})`,backgroundRepeat  : 'no-repeat', backgroundPosition: '',}}>

                <div className="container px-md-5 mb-5">
                    <div className="text-center display-6 fw-bold mb-5 ">New Trend</div>
                    <Trends count={4} />
                </div>
            </div>

        </div>
    )
}
